import  './Menu.css';

const Menu = () => {
    return(
        <div className="Menustyle">
            <ul>
                <li> HOME </li>
                <li> lOGIN </li>
                <li> SIGN-UP </li>
            </ul>
        </div>
    )
}

export default Menu;
